import Header from '@/components/Header/header';
import Footer from '@/components/Footer/footer';
import './App.less';
import type { AppProps /*, AppContext */ } from 'next/app';

function App({ Component, pageProps }: AppProps) {
  return (
    <React.Fragment>
      <Header />
      <Component {...pageProps} />
      <Footer />
    </React.Fragment>
  );
}

export default App;
